<rz-body #body0 [style]="{'paddingBottom': '0', 'paddingLeft': '0', 'paddingRight': '0', 'paddingTop': '0'}">
  <rz-content-container #contentContainer0 name="contentContainer0">
  </rz-content-container>
</rz-body>
<rz-header #header0 [style]="{'backgroundColor': '#F1903C'}">
  <div class="row justify-content-start align-items-center" [ngStyle]="{'height': '50px'}" (click)="onClickStartDashboard()">
    <div class="col-9 col-sm-9 col-md-9 col-lg-9 col-xl-9 align-items-start d-flex" [ngStyle]="{'backgroundColor': 'rgba(0, 0, 0, 0)', 'marginLeft': '', 'marginRight': '', 'marginTop': '', 'paddingLeft': '30px', 'paddingRight': ''}" (click)="onClickNavigateBack()">
      <rz-label #label0 [style]="{'color': '#f5f5f5', 'fontFamily': 'verdana,geneva,sans-serif', 'fontSize': '18px', 'fontWeight': 'normal', 'marginTop': '1px'}" text="Infos">
      </rz-label>
    </div>
    <div class="text-lg-right           justify-content-end d-flex           col-3 col-sm-3 col-md-3 col-lg-3 col-xl-3" [ngStyle]="{'display': 'inline-block', 'float': 'right', 'marginTop': '-4px', 'paddingRight': '29px', 'textAlign': 'right'}">
      <rz-icon #icon0 icon="dashboard" [style]="{'color': '#f5f5f5', 'fontSize': '24px', 'fontWeight': 'normal', 'marginTop': '8px'}">
      </rz-icon>
    </div>
  </div>
</rz-header>
<router-outlet></router-outlet>
